import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';

import * as serviceWorker from './serviceWorker';

import { createStore } from 'redux';
import {Provider} from 'react-redux'    //like HoC provide the application with store by wrapping around App
//a glue between react app & reuxx store
import rootReducer from "./reducers/rootReducer"; 

const store = createStore(rootReducer); //only this reducer interacts with store


ReactDOM.render(<Provider store={store} ><App /></Provider> , document.getElementById('root'));

// If you want your app to work offline and load faster, you can change
// unregister() to register() below. Note this comes with some pitfalls.
// Learn more about service workers: https://bit.ly/CRA-PWA
serviceWorker.unregister();
